import React, { useState, useEffect } from "react";
import { styled } from "@mui/material/styles";
import {
  AppBar,
  Toolbar,
  Typography,
  Avatar,
  Drawer,
  List,
  ListItem,
  ListItemIcon,
  ListItemText,
  Container,
  Grid,
  Card,
  CardContent,
  CardMedia,
  Button,
  CircularProgress,
} from "@mui/material";
import { Image, Home, UploadFile, Delete } from "@mui/icons-material";
import { DropzoneArea } from "material-ui-dropzone";
import axios from "axios";
import logo from "./logo.png";
import bgImage from "./plant.jpeg";

const drawerWidth = 240;
const Main = styled("main", { shouldForwardProp: (prop) => prop !== "open" })
(({ theme, open }) => ({
  marginLeft: open ? drawerWidth : 0,
  transition: theme.transitions.create("margin", {
    easing: theme.transitions.easing.sharp,
    duration: theme.transitions.duration.leavingScreen,
  }),
}));

export default function ImageUpload() {
  const [file, setFile] = useState(null);
  const [preview, setPreview] = useState(null);
  const [prediction, setPrediction] = useState(null);
  const [loading, setLoading] = useState(false);

  useEffect(() => {
    if (!file) return;
    const objectUrl = URL.createObjectURL(file);
    setPreview(objectUrl);
    return () => URL.revokeObjectURL(objectUrl);
  }, [file]);

  const handleFileUpload = (files) => {
    if (files.length > 0) {
      setFile(files[0]);
      setPrediction(null);
    }
  };

  const uploadImage = async () => {
    setLoading(true);
    const formData = new FormData();
    formData.append("file", file);
    try {
      const { data } = await axios.post("http://localhost:5000/upload", formData);
      setPrediction(data);
    } catch (error) {
      console.error("Error uploading file", error);
      alert("Upload failed.");
    } finally {
      setLoading(false);
    }
  };

  return (
    <div style={{ display: "flex" }}>
      <Drawer
        sx={{ width: drawerWidth, flexShrink: 0 }}
        variant="permanent"
        anchor="left"
      >
        <Toolbar />
        <List>
          {["Home", "Upload", "Results"].map((text, index) => (
            <ListItem button key={text}>
              <ListItemIcon>
                {index === 0 ? <Home /> : index === 1 ? <UploadFile /> : <Image />}
              </ListItemIcon>
              <ListItemText primary={text} />
            </ListItem>
          ))}
        </List>
      </Drawer>

      <Main>
        <AppBar position="fixed" sx={{ background: "#4caf50", ml: drawerWidth }}>
          <Toolbar>
            <Typography variant="h6" sx={{ flexGrow: 1 }}>
              Plant Disease Detection
            </Typography>
            <Avatar src={logo} />
          </Toolbar>
        </AppBar>
        <Toolbar />
        <Container
          sx={{
            backgroundImage: `url(${bgImage})`,
            backgroundSize: "cover",
            minHeight: "90vh",
            display: "flex",
            justifyContent: "center",
            alignItems: "center",
            flexDirection: "column",
            paddingTop: "20px",
          }}
        >
          {!file ? (
            <DropzoneArea acceptedFiles={['image/*']} onChange={handleFileUpload} />
          ) : (
            <Card sx={{ maxWidth: 400, textAlign: "center", padding: 2 }}>
              <CardMedia component="img" height="300" image={preview} />
              <CardContent>
                {loading ? (
                  <CircularProgress />
                ) : prediction ? (
                  <Typography variant="h6">{`Detected: ${prediction.class} (${(prediction.confidence * 100).toFixed(2)}%)`}</Typography>
                ) : (
                  <Button variant="contained" color="primary" onClick={uploadImage}>
                    Analyze Image
                  </Button>
                )}
                <Button
                  startIcon={<Delete />}
                  sx={{ marginTop: 2 }}
                  onClick={() => setFile(null)}
                >
                  Remove Image
                </Button>
              </CardContent>
            </Card>
          )}
        </Container>
      </Main>
    </div>
  );
}
